description:
With a budget 10 times larger than the first, Pirates #2 promises to deliver astounding special effects &amp; a star-studded cast including a scene between Jesse Jane Belladonna that is not to be missed! As if that's not enough, you will also get to see the first ever boy/girl scene for sizzling hot newcomer &amp; Digital Playground contract girl, Riley Steele.

Wild, intense &amp; darker than the original, Pirates #2 - Stagnetti's Revenge has it all. An exciting plot, memorable characters &amp; a fervent sexual chemistry like none the adult industry has ever witnessed.


